def day1pt1(instructions):
    sum = 0
    for i in instructions:
        if i == "(":
            sum += 1
        else:
            sum -= 1
    return sum

def day1pt2(instructions):
    sum = 0
    for j in range(len(instructions)):
        i = instructions[j]
        if i == "(":
            sum += 1
        else:
            sum -= 1
        if sum == -1: return j+1


